```
@RunWith(MockitoJUnitRunner.class)
public class ServiceTests {

    @Mock
    DaoUsedByServiceToBeTested dao;

    @InjectMocks
    ServiceToBeTested service;

    //You need to check if your services cover the lines in your source code involved in your service
    //This includes your constructors and getters-setters
    //When these constructors/getters/setters involve variables and parameters, simply input them inside the test classes normally

    //if Method to be tested returns something (NON-VOID)
    @Test
    public void testMethod1() {

        //This line simulates a return scenario when the dao method is called
        //variable "anyExpectedAnswer" should have the same data type as the non-void return
        Mockito.when(dao.daoMethod()).thenReturn(anyExpectedAnswer);

        //this line checks to see if the above logic was achieved when the service calls the dao
        //Assert.assertEquals(expectedValue, actualValueReturnByService)
        //Notice that you only use the service INSIDE the ASSERT.        
        Assert.assertEquals(anyExpectedAnswer, service.methodThatUsesTheDao());

    }

    //if Method to be tested is VOID
    @Test
    public void testMethod2() {

        ObjectOfAnyType mockObject = new ObjectOfAnyType();

        Mockito.doAnswer( i -> {

            mockObject.doSomethingThatWillChangeThis();

            //because the method is void type
            return null;
        }).when(dao).methodToBeTested();

        service.methodCallingDao();

        //Assert.assertEquals(expectedValue, actualValueReturnByService)
        Assert.assertEquals(expectedValueOfDaoChanges, dao.getValueOfChanges());
    }
}
```

